import React from 'react';

/**
 * AdminOrders displays a filterable list of orders.  This placeholder
 * provides a description of the intended features; implement the
 * functionality when connecting to a backend.
 */
function AdminOrders() {
  return (
    <div>
      <h1 className="text-2xl font-semibold mb-4">Управление заказами</h1>
      <p className="text-gray-600">Здесь вы сможете просматривать, фильтровать и обновлять заказы.  Функциональность фильтрации, изменения статуса, возвраты и оформления возвратов будет реализована при подключении к серверу.</p>
    </div>
  );
}

export default AdminOrders;
